mongo_list[0]:
[
    {
        "$match": {"result.input_url": {"$in":{{keywords}}}}
    },
    {
        "$project": {
            "_id": 0,
            "任务ID": "$result.task_id",
            "原始链接": "$result.input_url",
            "用户名": "$result.author_username",
            "作者昵称": "$result.author_nickname",
            "作者粉丝数": "$result.author_followers",
            "视频描述": "$result.video_desc",
            "视频链接": "$result.video_url",
            "点赞数": "$result.stats_digg",
            "播放数": "$result.stats_play",
            "发布时间": "$result.create_time",
            "抓取时间": "$result.crawled_at"
        }
    }
]
